import React from "react";
import World from "../../svg/308065.svg";
import { SVGMap } from "react-svg-map";
import './svg.css'

export default function Marketing(){
    return(
        <>
            <SVGMap locationClassName="location" className="mysvg" map={World}/>
        </>
    );
}
